import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { AuthContext } from './AuthContext';

ReactDOM.render(
  <React.StrictMode>
    <AuthContext></AuthContext>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

